import Contacts from './components/Contacts';
import { library } from '@fortawesome/fontawesome-svg-core';
import { fab } from '@fortawesome/free-brands-svg-icons';  /* import brands from font awesome */
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import './App.css';

library.add        (fab,faEnvelope);  /* add brands in the library so I can simply write brand names as string */

class App extends React.Component {
render(){
document.title='C.R.I Fluid Systems'
return(

<div>

<Header />
<Introduction />
<Achievement />
<Accessories />
<Contacts />

</div>

);  //return ends here
}  //render ends here
}  //class ends here

export default App;
